const float MDF_FONT::g_LineHeight = 1.171875f;

void MDF_FONT::Initialize() {
    memset(g_GlyphLookup, -1, sizeof(g_GlyphLookup));

    for (int i = 0; i < g_FontHeader.m_nNumGlyphs; ++i) {
        const uint32_t s_CodePoint = g_GlyphData[i].m_Charcode;

        if (s_CodePoint < 256) {
            g_GlyphLookup[s_CodePoint] = i;
        }
    }
}

const MDF_FONT::SGlyphData* MDF_FONT::GetGlyphData(const uint32_t p_Charcode) {
    if (p_Charcode > 255) {
        return nullptr;
    }

    const int32_t s_Index = g_GlyphLookup[p_Charcode];

    if (s_Index < 0) {
        return nullptr;
    }

    return &g_GlyphData[s_Index];
}

bool MDF_FONT::HasGlyph(const uint32_t c) {
    return MDF_FONT::g_GlyphLookup[c] != -1;
}

uint32_t MDF_FONT::DecodeUTF8(const char*& p) {
    const uint8_t c = *p;

    if (c < 0x80) {
        return *p++;
    }
    else if ((c >> 5) == 0x6) {
        const uint32_t s_CodePoint = ((c & 0x1F) << 6) |
            (p[1] & 0x3F);

        p += 2;

        return s_CodePoint;
    }
    else if ((c >> 4) == 0xE) {
        const uint32_t s_CodePoint = ((c & 0x0F) << 12) |
            ((p[1] & 0x3F) << 6) |
            (p[2] & 0x3F);

        p += 3;

        return s_CodePoint;
    }
    else if ((c >> 3) == 0x1E) {
        const uint32_t s_CodePoint = ((c & 0x07) << 18) |
            ((p[1] & 0x3F) << 12) |
            ((p[2] & 0x3F) << 6) |
            (p[3] & 0x3F);

        p += 4;

        return s_CodePoint;
    }

    p++;

    return '?';
}

void MDF_FONT::CalcBoundingBox(STextBoundingBox& p_TextBoundingBox, const char* p_Text)
{
    float s_MinX = std::numeric_limits<float>::infinity();
    float s_MaxX = -std::numeric_limits<float>::infinity();
    float s_MinY = std::numeric_limits<float>::infinity();
    float s_MaxY = -std::numeric_limits<float>::infinity();

    float penX = 0.f;

    for (const char* p = p_Text; *p; ++p) {
        const SGlyphData* s_GlyphData = GetGlyphData(static_cast<uint8_t>(*p));

        if (!s_GlyphData) {
            continue;
        }

        float s_Left = penX + s_GlyphData->m_PlaneLeft;
        float s_Right = penX + s_GlyphData->m_PlaneRight;
        float s_Bottom = s_GlyphData->m_PlaneBottom;
        float s_Top = s_GlyphData->m_PlaneTop;

        s_MinX = std::min(s_MinX, s_Left);
        s_MaxX = std::max(s_MaxX, s_Right);
        s_MinY = std::min(s_MinY, s_Bottom);
        s_MaxY = std::max(s_MaxY, s_Top);

        penX += s_GlyphData->m_Advance;
    }

    if (!std::isfinite(s_MinX)) {
        s_MinX = s_MaxX = s_MinY = s_MaxY = 0.f;
    }

    p_TextBoundingBox.m_fMinX = s_MinX;
    p_TextBoundingBox.m_fMaxX = s_MaxX;
    p_TextBoundingBox.m_fMinY = s_MinY;
    p_TextBoundingBox.m_fMaxY = s_MaxY;
}

void MDF_FONT::RenderQuad(
    uint32_t p_Charcode,
    const float p_Scale,
    float& p_PenX,
    const float p_PenY,
    float* pVertices,
    float* pTexCoords
) {
    const SGlyphData* s_GlyphData = GetGlyphData(p_Charcode);

    if (!s_GlyphData) {
        return;
    }

    float s_Left = s_GlyphData->m_PlaneLeft * p_Scale;
    float s_Bottom = s_GlyphData->m_PlaneBottom * p_Scale;
    float s_Right = s_GlyphData->m_PlaneRight * p_Scale;
    float s_Top = s_GlyphData->m_PlaneTop * p_Scale;

    float s_X0 = p_PenX + s_Left;
    float s_Y0 = p_PenY + s_Bottom;
    float s_X1 = p_PenX + s_Right;
    float s_Y1 = p_PenY + s_Top;

    // Vertex order: bottom-left, bottom-right, top-right, top-left
    pVertices[0] = s_X0; pVertices[1] = s_Y0;
    pVertices[2] = s_X1; pVertices[3] = s_Y0;
    pVertices[4] = s_X1; pVertices[5] = s_Y1;
    pVertices[6] = s_X0; pVertices[7] = s_Y1;

    pTexCoords[0] = s_GlyphData->m_TexU0; pTexCoords[1] = s_GlyphData->m_TexV1; // bottom-left
    pTexCoords[2] = s_GlyphData->m_TexU1; pTexCoords[3] = s_GlyphData->m_TexV1; // bottom-right
    pTexCoords[4] = s_GlyphData->m_TexU1; pTexCoords[5] = s_GlyphData->m_TexV0; // top-right
    pTexCoords[6] = s_GlyphData->m_TexU0; pTexCoords[7] = s_GlyphData->m_TexV0; // top-left

    p_PenX += s_GlyphData->m_Advance * p_Scale;
}

float MDF_FONT::GetAdvanceWidth(const uint32_t p_Charcode) {
    const MDF_FONT::SGlyphData* s_GlyphData = MDF_FONT::GetGlyphData(p_Charcode);

    return s_GlyphData ? s_GlyphData->m_Advance : 0.f;
}